need to create a mongoose transaction wrapper which will pass session as parameter to functions that actually do query operations to create or update<p>So lets say i have a function that takes care of user creation which was previously available to us. Now we just want the function to work in the form of one transaction that creates all users together if success or fails completely when it encounters any error. I am assuming passing just the session to the existing function from the transaction wrapper should take care of this. Any number of such function can be passed together and the wrapper should handle them all as a single transaction.</p>
<pre><code> const createUsers = async (users = []) =&gt; {
  try {
    return UserModel.create(users).then((res) =&gt; {
      logger.info(`[Start-Up] Created ${res.length} users`);
    }, (rej) =&gt; {
      logger.error(`[Start-Up] Failed to create users - ${rej}`);
      throw new Error(rej);
    });
  } catch (err) {
    throw new Error('Failed to create Users', err);
  }
};
</code></pre>

