MongoDB Aggregate multiple local fields on $lookup<p>I'm using an aggregate to get 4 child Documents per each Parent Doc. The child documents are all from the same Collection though.</p>
<pre><code>   [
  {
    '$lookup': {
      'from': 'Roles', 
      'localField': 'dentistId', 
      'foreignField': '_id', 
      'as': 'DENTIST'
    }
  }, {
    '$lookup': {
      'from': 'Roles', 
      'localField': 'doctorId', 
      'foreignField': '_id', 
      'as': 'DOCTOR'
    }
  }, {
    '$lookup': {
      'from': 'roles', 
      'localField': 'lawyerId', 
      'foreignField': '_id', 
      'as': 'LAWYER'
    }
  }, {
    '$lookup': {
      'from': 'roles', 
      'localField': 'ceoId', 
      'foreignField': '_id', 
      'as': 'CEO'
    }
  }
]
</code></pre>
<p>I'm using a version of MongoDB &gt; 4. I'm looking to just have 1 <code>$lookup</code> and then do something like</p>
<pre><code>localField: { $in:[dentistId, doctorId, lawyerId, ceoId }
</code></pre>
<p>Is there any way to consolidate this?</p>
<p>Thanks!</p>

