How to show suggestions in MongoDB find()<p>I'm using mongoDB Atlas to store some data.
The collection is like,</p>
<pre><code>var User = new Schema({
    firstname: {
        type: String,
        default: ''
    },
    lastname: {
        type: String,
        default: ''
    }
}, {
    timestamps: true
});
</code></pre>
<p>But I'm using Passport for authentication, username and password is handled by it.</p>
<p>When searching for users by username, I want to display a list of usernames with matching characters.
Like, auto complete suggestions.</p>
<p>I realize I have to use regex in some way to achieve this, but I don't know how!
For now, I'm doing this,</p>
<pre><code>router.post('/search', corsWithOptions, (req, res, next) =&gt; {
  User.findByUsername(req.body.username).then(user =&gt; {
    console.log(user);
    res.json(user)
  })
})
</code></pre>
<p>But until the entire username is available, this method returns null.
Here, <code>findByUsername</code> is a method in Passport, takes 2 params (username, selectHashSaltFields).</p>
<p>I also tried this,</p>
<pre><code>    User.find({
      $or: [
        {
          username: { '$regex': '.*' + req.body.search, $options: 'i' },
          firstname: { '$regex': '.*' + req.body.search, $options: 'i' },
          lastname: { '$regex': '.*' + req.body.search, $options: 'i' }
        }
      ]
    }).then(user =&gt; {
      console.log(user)
    })
</code></pre>
<p>This is returning an empty list, even when the values exist</p>
<p>This is a MERN stack, how to query documents and show suggestions for auto complete in frontend?</p>

